import React from 'react';
import lilypad from './lilypad.png';

const LilyPad = () => {
  return (
    <div>
      <h2>Project 1</h2>
      <p>Description of Project 1</p>
      <img src={lilypad} alt="LilyPad Project" className="project-image" />
    </div>
  );
};

export default LilyPad;
